(4, 'c', '/general/memberHome.jsp', '2013-12-30 01:53:49', '<%@ taglib uri="http://java.sun.com/jsp/jstl/core" prefix="c" %>\n<%@ taglib uri="http://java.sun.com/jsp/jstl/functions" prefix="fn" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-bean" prefix="bean" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-html" prefix="html" %>\n<%@ taglib uri="http://www.servletsuite.com/servlets/toggletag" prefix="t" %> \n<%@ taglib uri="http://sslext.sf.net/tags/sslext" prefix="ssl" %>\n<%@ taglib uri="http://devel.cyclos.org/tlibs/cyclos-core" prefix="cyclos" %>\n\n<c:if test="${generateTransactionPassword}">\n	<jsp:include flush="true" page="/pages/access/transactionPassword/generateTransactionPassword.jsp"></jsp:include>\n</c:if>\n\n<c:if test="${status.hasData}">\n	<jsp:include flush="true" page="memberStatus.jsp"/>\n</c:if>\n\n<c:if test="${not empty quickAccess}">\n	<jsp:include flush="true" page="quickAccess.jsp"/>\n</c:if>\n\n<!--\n<table class="defaultTableContent" cellspacing="0" cellpadding="0">\n    <tr>\n        <td class="tdHeaderTable"><bean:message key="home.member.news.title"/></td>\n        <cyclos:help page="home#home_news"/>\n    </tr>\n    <tr> \n        <td class="tdContentTable" colspan="2">\n        	<cyclos:includeCustomizedFile type="static" name="general_news.jsp"/>\n        </td>\n   </tr>\n</table>\n-->\n\n<c:if test="${cyclos:granted(BasicPermission.BASIC_INVITE_MEMBER)}">\n	<jsp:include flush="true" page="invitePerson.jsp"/>\n</c:if>\n', 'A', NULL, NULL, '<%@ taglib uri="http://java.sun.com/jsp/jstl/core" prefix="c" %>\n<%@ taglib uri="http://java.sun.com/jsp/jstl/functions" prefix="fn" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-bean" prefix="bean" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-html" prefix="html" %>\n<%@ taglib uri="http://www.servletsuite.com/servlets/toggletag" prefix="t" %> \n<%@ taglib uri="http://sslext.sf.net/tags/sslext" prefix="ssl" %>\n<%@ taglib uri="http://devel.cyclos.org/tlibs/cyclos-core" prefix="cyclos" %>\n\n<c:if test="${generateTransactionPassword}">\n	<jsp:include flush="true" page="/pages/access/transactionPassword/generateTransactionPassword.jsp"></jsp:include>\n</c:if>\n\n<c:if test="${status.hasData}">\n	<jsp:include flush="true" page="memberStatus.jsp"/>\n</c:if>\n\n<c:if test="${not empty quickAccess}">\n	<jsp:include flush="true" page="quickAccess.jsp"/>\n</c:if>\n\n<table class="defaultTableContent" cellspacing="0" cellpadding="0">\n    <tr>\n        <td class="tdHeaderTable"><bean:message key="home.member.news.title"/></td>\n        <cyclos:help page="home#home_news"/>\n    </tr>\n    <tr> \n        <td class="tdContentTable" colspan="2">\n        	<cyclos:includeCustomizedFile type="static" name="general_news.jsp"/>\n        </td>\n   </tr>\n</table>\n\n<c:if test="${cyclos:granted(BasicPermission.BASIC_INVITE_MEMBER)}">\n	<jsp:include flush="true" page="invitePerson.jsp"/>\n</c:if>\n', '<%@ taglib uri="http://java.sun.com/jsp/jstl/core" prefix="c" %>\n<%@ taglib uri="http://java.sun.com/jsp/jstl/functions" prefix="fn" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-bean" prefix="bean" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-html" prefix="html" %>\n<%@ taglib uri="http://www.servletsuite.com/servlets/toggletag" prefix="t" %> \n<%@ taglib uri="http://sslext.sf.net/tags/sslext" prefix="ssl" %>\n<%@ taglib uri="http://devel.cyclos.org/tlibs/cyclos-core" prefix="cyclos" %>\n\n<c:if test="${generateTransactionPassword}">\n	<jsp:include flush="true" page="/pages/access/transactionPassword/generateTransactionPassword.jsp"></jsp:include>\n</c:if>\n\n<c:if test="${status.hasData}">\n	<jsp:include flush="true" page="memberStatus.jsp"/>\n</c:if>\n\n<c:if test="${not empty quickAccess}">\n	<jsp:include flush="true" page="quickAccess.jsp"/>\n</c:if>\n<!-- \n<table class="defaultTableContent" cellspacing="0" cellpadding="0">\n    <tr>\n        <td class="tdHeaderTable"><bean:message key="home.member.news.title"/></td>\n        <cyclos:help page="home#home_news"/>\n    </tr>\n    <tr> \n        <td class="tdContentTable" colspan="2">\n        	<cyclos:includeCustomizedFile type="static" name="general_news.jsp"/>\n        </td>\n   </tr>\n</table>\n -->\n\n<c:if test="${cyclos:granted(BasicPermission.BASIC_INVITE_MEMBER)}">\n	<jsp:include flush="true" page="invitePerson.jsp"/>\n</c:if>\n', NULL),
(5, 'c', '/access/includes/loginForm.jsp', '2013-12-30 16:28:42', '<%@ taglib uri="http://java.sun.com/jsp/jstl/core" prefix="c" %>\n<%@ taglib uri="http://jakarta.apache.org/struts/tags/struts-bean" prefix="bean" %>\n<%@ taglib uri="http://devel.cyclos.org/tlibs/cyclos-core" prefix="cyclos" %>\n\n<form id="cyclosLogin">\n<input type="hidden" name="operatorLogin" value="${empty param.operator ? false : param.operator}" />\n<input type="hidden" name="principalType" value="${selectedPrincipalType}" />\n<table class="nested">\n	<c:if test="${param.operator}">\n		<tr>\n			<td nowrap="nowrap" class="label" width="40%">Nmero da Conta</td>\n			<td><input id="cyclosMember" name="member" class="medium"/></td>\n		</tr>\n	</c:if>\n	<tr>\n		<td nowrap="nowrap" class="label" width="40%">Nmero da Conta</td>\n		<td><c:choose><c:when test="${empty selectedPrincipalType.customField}">\n				<input id="cyclosUsername" name="principal" class="small"/>\n			</c:when><c:otherwise>\n				<cyclos:customField field="${selectedPrincipalType.customField}" valueName="principal" styleId="cyclosUsername" search="true" size="medium"/>\n			</c:otherwise></c:choose></td>\n	</tr>\n	<tr>\n		<td nowrap="nowrap" class="label"><bean:message key="login.password"/></td>\n		<td><input type="password" id="cyclosPassword" class="small"/></td>\n	</tr>\n	<c:choose><c:when test="${accessSettings.virtualKeyboard}">\n		<tr>\n			<td colspan="2" align="center">\n				<script>renderVirtualKeyboard();</script>\n			</td>\n		</tr>\n	</c:when><c:otherwise>\n		<tr>\n			<td colspan="2" align="right">\n				<br class="small">\n				<input type="submit" class="button" value="<bean:message key="global.submit"/>">\n			</td>\n		</tr>\n	</c:otherwise></c:choose>\n	<c:if test="${not empty accessLinks}">\n		<tr>\n			<td colspan="2" align="${accessSettings.virtualKeyboard ? ''center'': ''right''}">\n				<br class="small">\n				<c:choose><c:when test="${not empty singleAccessLink}">\n					<c:url value="/do/login" var="url">\n						<c:pa