INSERT INTO `registration_agreements` (`id`, `name`, `contents`) VALUES
(1, 'Contrato General de Cuenta Bancaria', '<p style="margin-bottom: 0in; line-height: 100%"><font face="Trebuchet MS, serif"><font style="font-size: 26pt"><span lang="es-AR"><b>Contrato General de Cuenta</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Trebuchet MS, serif"><font style="font-size: 26pt"><span lang="es-AR"><b>Bancaria</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>1. EFECTIVIDAD DELCONTRATO Y LOS SERVICIOS OFRECIDOS POR EL BANCO</b></span></font></font> <font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">......................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>1.</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>2. LEYAPLICABLE, JURISDICCIN Y DIVULGACION DE INFORMACION</b></span></font></font> <font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">..........................................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>1.</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">A. Ley Aplicable .. ......................................................................................................................................................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>1.</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">B. Sujecin a Jurisdiccin .........................................................................................................................................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>1.</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">C. Poltica de Privacidad e Informacin Confidencial ................................................................................................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>2.</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>3. INSTRUCCIONES DEL CLIENTE</b></span></font></font> <font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">.................................................................................................................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>2.</b></span></font></font></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%"><font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>4. CAMBIO DE DIRECCIN</b></span></font></font> <font face="Arial, serif"><font style="font-size: 8pt"><span lang="es-AR">...............................................................................................................................</span></font></font> <font face="Arial, serif"><font style="font-size: 9pt"><span lang="es-AR"><b>2.</b></span></font></font><