"margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0in; line-height: 100%" lang="es-AR"></p><p style="margin-bottom: 0.14in"><font size="4"><span lang="es-AR"><b>CONTRATO BANCARIO GENERAL DE CUENTA</b></span></font></p><p style="margin-bottom: 0.14in"><font style="font-size: 9pt"><span lang="es-AR"><b>PREMBULO</b></span></font></p><p style="margin-bottom: 0.14in" align="justify"><font size="3"><span lang="es-AR">Bienvenido a Acacia Bank S/A (en adelante, el Banco) y gracias por abrir la Cuenta con nosotros. Este Contrato establece los trminos y condiciones relacionadas con la Cuenta y los productos y servicios que el Banco provee. Adems, usted puede recibir otros documentos en los que constan declaraciones aplicables a la Cuenta (Documentos de Declaraciones) y tales Documentos de Declaraciones tambin formarn parte de este Contrato.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El presente Contrato aparece publicado en la pgina de internet del Banco (www.acaciabank.com.pa), a travs de la cual usted podr tener acceso al mismo, sus trminos y condiciones, a efectos de conocer la informacin sobre la Cuenta o producto que mantenga con el Banco. Sin perjuicio de lo anterior, el Banco podr poner a su disposicin una copia fsica del presente Contrato, contra la apertura de la Cuenta o de cualquier otro producto o servicio del banco regulado en el mismo. Igualmente, contra su solicitud, el Banco podr poner a su disposicin una copia fsica del presente Contrato.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Los trminos Depositante, Cliente, Titular de la Cuenta, Nombre en la Cuenta, Usted, algunos de ustedes, suyo, suyos, cuando se usan en este Contrato, significan el dueo o dueos conjuntos de cualquiera de las Cuentas descritas aqu.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Los trminos nosotros, nuestro, nuestros, y el Banco, cuando se usan en este Contrato, significa Acacia Bank S/A; entidad bancaria con la cual usted est abriendo una cuenta bajo este Contrato.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El trmino Cuenta cuando se usa en este Contrato significa cualquiera y todas las Cuentas o depsitos mantenidos por el Cliente en el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El trmino Persona Autorizada, Cotitular, cuando se usa en este Contrato, significa cada individuo que tiene firma autorizada [mediante un Registro de Firma] con los mismos derechos de retiro y depsito que el Cliente tiene en la Cuenta, pero sujeto en cada caso a las limitaciones aplicables segn el tipo de Cuenta y lo establecido en la Solicitud de Producto y Registro de Firmantes Autorizados.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Por el hecho de utilizar la Cuenta usted consiente estar obligado por los trminos y condiciones de este Contrato. Por el hecho de firmar una Solicitud de Apertura de Cuenta (Solicitud de Producto) como se define abajo, usted acuerda que cada una y todas las cuentas que usted establezca con el Banco y cada una y todas las cuentas que las reemplazan (cualquiera y cada una de tales cuentas estn siendo referidas aqu como la Cuenta) estn sujetas a estos trminos y condiciones y sus modificaciones (junto con la Solicitud de Producto, este Contrato), as como a las leyes de la Repblica de Panam que le sean aplicables; y las prcticas bancarias comerciales vigentes en la Repblica de Panam.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Cuando se est abriendo una Cuenta en el Banco, el Cliente y/o los Cotitulares que se incluyen en la Solicitud de Producto aceptan las siguientes condiciones:</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. El Depositante acuerda estar obligado (y cada uno y todos los sucesores, herederos, albaceas y otros representantes legales del Depositante estn obligados en todo momento) por el presente Contrato descrito ms adelante, y las modificaciones hechas al mismo, y otros acuerdos adicionales realizados por el Cliente y el Banco, y todas las reglas y regulaciones del Banco. El Banco se reserva el derecho de cambiar o modificar el presente Contrato de tiempo en tiempo, sin necesidad de notificacin previa al Depositante. Si usted mantiene sus depsitos con nosotros despus del da en el cual tales modificaciones son efectivas se considerar que usted ha aceptado tales modificaciones. Sin embargo, usted ser informado de las modificaciones que afectan sus derechos y obligaciones por correo, en la pgina de Internet del Banco o por el medio que disponga el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Cada individuo que firme la Solicitud de Producto est autorizando al Banco a entregar y/o obtener reportes de crdito o informacin sobre el comportamiento y las relaciones comerciales del Depositante respecto de su Cuenta personal y/o de las Cuentas de otras entidades que l o ella representa, para o de otras instituciones bancarias y agencias de crdito reconocidas y establecimientos comerciales, bases de datos pblicas o privadas, tanto nacionales como extranjeras, segn se requiera o se considere apropiado, sin responsabilidad alguna para el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Queda entendido que antes que el Banco ponga a disposicin del Depositante los servicios aqu mencionados y/o el otorgamiento de crditos, el Banco debe primero recibir toda la documentacin pertinente del Depositante y los Autorizados y haber aceptado la Solicitud de Producto.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">1. EFECTIVIDAD DELCONTRATO YLOS SERVICIOS OFRECIDOS POR ELBANCO</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Cliente entiende y acuerda que los servicios establecidos en el presente Contrato y los derechos y deberes de las partes aqu establecidos estn sujetos a:</span></font></p><ol type="i"><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">que el Banco reciba toda la informacin y documentacin pertinente del Cliente, los Cotitulares y los Firmantes Autorizados,</span></font></p></li><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">la aceptacin de laSolicitud de Producto por parte del Banco, y</span></font></p></li><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">al cumplimiento con los dems trminos y condiciones que pueda establecer el Banco de tiempo en tiempo para la oferta de sus productos y servicios.</span></font></p></li></ol><p style="margin-bottom: 0.14in" lang="es-AR"><br/> </p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">2. LEYAPLICABLE, JURISDICCIN YDIVULGACION DE INFORMACION.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. Ley Aplicable.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">En razn del principio de especialidad, la Cuenta est regida por el presente Contrato, y en lo que se refiera a asuntos que en este no se hallen especialmente determinados, por las leyes de la Repblica de Panam, que estn vigentes o puedan ser adoptadas en el futuro, y en su defecto por los usos y costumbres bancarios locales e internacionales; sin perjuicio de aquellas normas que sean de obligatorio cumplimiento.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Sujecin a Jurisdiccin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Usted acuerda que todos los procedimientos legales relacionados con la Cuenta tienen que ser presentados ante los tribunales de la Repblica de Panam, los cuales usted acuerda que tendrn jurisdiccin exclusiva sobre este Contrato y cualquier otro acuerdo que usted tenga con el Banco o cualquier disputa que resulte bajo ste, y usted irrevocablemente acuerda someterse a la jurisdiccin de cualquiera de estos tribunales con respecto a tales procedimientos y disputas. Adems, usted aqu renuncia irrevocablemente, segn sea permitido por la ley, a cualquier reclamo de que tal demanda ha sido presentada ante un tribunal cuyo foro es inconveniente. Usted tambin acuerda irrevocablemente que la sentencia final en relacin con tales procedimientos ante dicho tribunal es definitiva y que la sentencia se puede ejecutar en cualquier jurisdiccin o de cualquier otra forma. Sin embargo, nada en este Contrato puede excluir o de ninguna manera limitar el derecho del Banco a demandarlo o tomar cualquier accin en contra suya en cualquier tribunal, donde quiera que est localizado, con jurisdiccin sobre usted o algunos de sus activos.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Adicionalmente, usted reconoce que el dinero y dems bienes y valores depositados en el Banco se consideran domiciliados en la Repblica de Panam, por tanto estn sujetos a la jurisdiccin de los tribunales panameos. Por su parte, el dinero y dems bienes y valores depositados en el Banco, cuyo Depositante sea una persona de nacionalidad no panamea y no residente en la Repblica de Panam al momento en que se perfeccione la transferencia de tales dineros, bienes y valores, quedan sometidos plenamente al principio de la autonoma de la voluntad y al rgimen de libre disposicin de bienes, an cuando las leyes sucesoria o el rgimen matrimonial del pas de la nacionalidad o del domicilio del Depositante dispongan otra cosa.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Poltica de Privacidad e Informacin Confidencial.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco no divulga informacin sobre el Depositante y sus operaciones financieras pasada ni presente (Informacin Confidencial) a terceros, excepto cuando medie consentimiento expreso por parte del Depositante, y en los casos en que sea permitido</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">por la ley. El Banco queda expresamente autorizado para divulgar Informacin Confidencial en los siguientes casos:</span></font></p><ul><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Cuando la informacin fuese requerida por autoridad competente en la Repblica de Panam de conformidad con la ley.</span></font></p></li><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Cuando por iniciativa propia el Banco deba proporcionarla en cumplimiento de leyes panameas o estndares internacionales en materia de prevencin</span></font></p></li><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">de los delitos de blanqueo de capitales, financiamiento del terrorismo y delitos relacionados; o en cumplimiento de leyes panameas, estndares internacionales o polticas en materia de transparencia tributaria.</span></font></p></li><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A agencias calificadoras para fines de anlisis de riesgo.</span></font></p></li><li><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A agencias u oficinas procesadoras de datos para fines contables y operativos, cual incluye nuestra casa matriz, subsidiarias y filiales del banco en caso de tercerizaciones de actividades o proceso, sin perjuicio de trasladar el deber de confidencialidad.</span></font></p></li></ul><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">3. INSTRUCCIONES DELCLIENTE.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco puede requerir que cualquier pregunta relacionada con la Cuenta debe ser enviada por fax, documento digitalizado, correo regular o servicio de correo expreso a su representante de cuenta a la direccin del Banco. El Banco slo aceptar instrucciones por telfono, fax, documento digitalizado, Sucursal Virtual en relacin con la Cuenta, segn lo que determine el Banco, y en particular con algn pago, retiro o transferencia de fondos, segn lo previsto en la Seccin sobre las Condiciones Aplicables a la Transferencia Electrnica de Fondos de este Contrato. Todas las instrucciones recibidas estarn sujetas a verificacin de que cumplen con los trminos de la referida Seccin. El Banco puede tambin requerir que usted siempre incluya el nmero de Cuenta en toda correspondencia.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">4. CAMBIO DE DIRECCIN.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco puede requerir que todo cambio de direccin postal sea notificado por escrito, mediante solicitud enviada por el Depositante al Banco. La correspondencia, incluyendo estados de cuenta enviados a la direccin registrada en el Banco, se considerar como correctamente enviada. Cualquier correspondencia, incluyendo estados de cuenta, devueltos al Banco porque el Depositante no le notific sobre el cambio de su direccin permanente generar la suspensin del envo de nueva correspondencia hasta que la direccin correcta haya sido recibida por el Banco, y el Banco tendr el derecho de cobrar los cargos por cuenta de terceros que correspondan por la devolucin de correo.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">5. TARIFAS, CARGOS Y PENALIDADES.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">La Cuenta est sujeta a los intereses, las comisiones, recargos y cargos por cuenta de terceros, segn lo previsto en el presente Contrato y sus respectivas modificaciones, y la tabla de productos y tarifas publicada por el Banco (Tabla de Productos y Tarifas) que ser informada al Depositante al momento de su vinculacin y de tiempo en tiempo cuando las mismas sean modificadas. La Tabla de Productos y Tarifas establecer el importe o mtodo de clculo de tales intereses, comisiones, recargos y cargos por cuenta de terceros, su periodicidad y dems condiciones especficas para el cobro de las mismas. La Cuenta estar sujeta a los intereses, comisiones, recargos y cargos por cuenta de terceros previamente acordado en el Contrato y la Tabla de Productos y Tarifas, incluyendo pero sin limitacin, comisiones, recargos y cargos por cuenta de terceros por saldo promedio mnimo inferior al acordado, servicio de valija, cheques devueltos por insuficiencia de fondos, sobregiros, investigacin de cargos que resultan de las peticiones del Depositante o por demanda legal, firmas de referencia o cartas de verificacin, cartas notariadas, servicios de mantenimiento, incluyendo Cuentas Inactivas (definidas ms adelante), rdenes de no pago de cheques emitidas por el Depositante, correo devuelto y cierre de la Cuenta. Igualmente, el Banco establecer en la Tabla de Productos y Tarifas, que ser informada al Depositante al momento de su vinculacin y de tiempo en tiempo cuando la misma sea modificada, el saldo mnimo a partir del cual los dineros depositados en la Cuenta devengarn intereses, la tasa de inters pagadera sobre la Cuenta, la forma en que dichos intereses sern computados, y la periodicidad en que sern pagados. No obstante el derecho que el Banco tiene de realizar cambios en las comisiones, recargos, cargos por cuenta de terceros e intereses sin notificacin previa, el Depositante ser informado con anticipacin sobre cualquier cambio a la Tabla de Productos y Tarifas por correo, o por cualquier otro medio establecido por el Banco, con indicacin de la fecha efectiva de entrada en vigencia de las mismas. Sin perjuicio de lo anterior, la Tabla de Productos y Tarifas actualizada estar disponible en la pgina web del Banco y en las oficinas de atencin al pblico del Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">6. NUESTROS DERECHOS.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. Costos Legales y Tarifas. El Depositante acuerda pagar una vez requerido todas las prdidas, costos y gastos (incluyendo sin limitacin las tarifas y gastos de abogado, bien sea que hayan sido incurridos en un juicio, apelacin o sin litigio alguno), si los hay, incurridos por el Banco en conexin con o en relacin con la ejecucin de los deberes y obligaciones contenidos en este Contrato o cualquier otro documento entregado bajo este Contrato, incluyendo pero no limitado a prdidas, costos y gastos sufridos como resultado de: (i) incumplimiento por el Depositante de sus obligaciones y (ii) cualquier reclamo por una tercera persona sin importar si es legalmente vlida o no, relacionada con el Depositante o la Cuenta del Depositante en el Banco; (iii) cualquier reclamo de un tercero relacionado con daos y perjuicios sufridos que sean consecuencia directa o indirecta de fraude o negligencia del Depositante, sus empleados o agentes o Personas Autorizadas.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Derecho de Compensar. Adems de cualquier derecho prendario o derecho de compensacin o similar al cual el Banco tendra derecho de conformidad con la ley, el Banco puede en cualquier momento y sin notificacin previa a usted (dicha notificacin siendo expresamente renunciada por usted) combinar o consolidar: (i) todas o cualquiera de las obligaciones y deudas (bien sea directas o indirectas, en calidad de deudor, garante, fiador o avalista, conjuntas o individuales, original o como resultado de una compra o cesin, y bien sea por principal, inters, gastos de abogados, u otros gastos o cualquier otra cantidad) que son ahora o de aqu en adelante debidas y pagables a el Banco por usted o cualquiera de ustedes (con o sin otros responsables), junto con: (ii) todas o cualquiera de las Cuentas (bien sea generales o especiales, incluyendo sin limitacin depsitos de los cuales son dueos conjuntamente o como unidad), inters sobre los mismos, balances y crditos mantenidos en el Banco por usted o algunos de ustedes (y cualquier obligacin de cualquier otra clase que el Banco le debe a usted o cualquiera de ustedes), por este medio compensando y aplicando esos activos de ustedes mencionados en la Seccin (ii) arriba, en el orden que el Banco decida, contra esas obligaciones y deudas de ustedes mencionadas en la Seccin (i) arriba. Los derechos de el Banco bajo las provisiones anteriores sern adems de, y no exclusivas de, algn derecho similar, incluyendo derechos de compensacin, a los que el Banco tiene derecho por ley u otro contrato. En el evento de que los activos mencionados en la Seccin (ii) arriba no sean suficientes para cubrir las obligaciones mencionadas en la Seccin (i) arriba, el Banco se reserva el derecho de sobregirar las Cuentas para reflejar los saldos adeudados, en cuyo caso sern de aplicacin las tasas de inters, comisiones, y recargos vigentes aplicables al servicio de sobregiro.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Gravmenes y Prendas.En consideracin de alguna extensin de crdito u otro acuerdo financiero, otorgado ahora o en el futuro o como continuacin de uno existente por el Banco a usted o alguno de ustedes, y como garanta de pago de todas las deudas, obligaciones y deudas (sean directos o indirectos, obligacin individual o solidaria, vencidos o no vencidos, liquidados o no liquidados, incondicionales o eventuales, originales o resultantes de adquisicin o cesin, y sean por capital, intereses, honorarios de abogados y otros costos o gastos) que ahora o en el futuro, usted o cualquiera de ustedes (con o sin otros deudores) le deba a el Banco (todas esas obligaciones y deudas se denominan el Endeudamiento), usted o cualquiera de ustedes pignoran a el Banco todo lo siguiente, exista ahora o en el futuro (la Garanta): (i) Cuentas, depsitos (generales o especiales incluyendo, sin limitacin, depsitos de propiedad conjunta o por la unidad), sus intereses correspondientes, saldos y crditos mantenidos con el Banco (o con alguna oficina de ste) o con un afiliado de el Banco por usted o cualquiera de ustedes (y toda clase de obligacin que el Banco o una sucursal o banco afiliado a el Banco, debiere al Titular), (ii) cualquiera y todos los dems activos (incluyendo, sin limitacin, todos los valores y otros activos de inversin) mantenidos en el Banco (en o con alguna oficina de ste) o en cualquier afiliado de el Banco por cuenta de o para la cuenta de usted o cualquiera de ustedes, y (iii) todos los dineros provenientes de las Garantas. Toda falta de pago al vencimiento de cualquier Endeudamiento en que incurra usted o cualquiera de ustedes, el Banco est autorizada por este Contrato para compensar y aplicar cualquier Garanta o sus fondos a dicho Endeudamiento, y a vender o liquidar de otra manera cualquier otra Garanta que hubiere y aplicar los fondos resultantes a dicho Endeudamiento, en cualquier momento, en cualquier medida y en cualquier orden por los cuales optare el Banco su sola discrecin. Esta prenda, hecha bajo este Contrato, permanecer e irrevocable hasta el momento en que todo el Endeudamiento est pagado por completo y el Banco est satisfecho con que no surgir mas Endeudamiento en el futuro.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">D. Derechos Relacionados. La prenda a que se refiere el literal C anterior se entender perfeccionada ante el incumplimiento del pago de algn Endeudamiento. Apartir de su perfeccionamiento, el Banco podr a su sola discrecin tomar o retener la posesin de cualquier o de todos los instrumentos o certificados que demuestren o representen la Garanta; as como de ah en adelante, por el tiempo que la prenda aqu referida siga vigente, toda Garanta capaz de ser renovada y redepositada ser automticamente renovada y redepositada en forma continua, a menos que el Banco opte por otra opcin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Mientras que la prenda aqu referida tenga vigencia, toda renovacin, reemplazo, o adicin de activos (y todo instrumento, recibo y otros documentos que representen tales activos) que se emitan o surjan de otra manera por razn de cualquier Garanta, se constituirn en Garanta adicional y sern retenidos por el Banco conforme a los trminos de esta Garanta. Por el presente Contrato el Banco queda autorizada para notificar a cualquier oficina o afiliada de el Banco sobre la Garanta aqu referida, y para ordenar que esa Garanta sea registrada en los libros de esa oficina o afiliada, y que tal oficina o afiliada acepte y acuerde por escrito los trminos de dicha Garanta. Usted autoriza por el presente Contrato a el Banco para que registre todos los documentos de financiamiento, los estados de continuidad u otros documentos o instrumentos que, a juicio de el Banco, demuestren, perfeccionen o protejan la seguridad de los intereses de el Banco aqu referidos; por el presente Contrato el Banco queda autorizada para registrar dichos documentos, sin su firma, en cualquier oficina pblica de cualquier jurisdiccin y para debitar de la Cuenta todos los costos de esos registros. El Banco tambin queda autorizada para debitar de la Cuenta y de aumentar el Endeudamiento garantizado aqu por el valor de todos los costos (incluyendo cualquier gasto de abogados, incurridos en juicio, apelacin o sin juicio), de cualquier venta, compensar o disponer de otra manera, o liquidar la Garanta bajo este Contrato. El Banco no ser responsable por rechazar ningn documento debido a falta de fondos en cualquiera de sus Cuentas que resulte de aplicar, compensar o bloquear fondos conforme a esta Garanta.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">E. Terminacin de la Cuenta. Salvo que se establezca algo distinto en las condiciones aplicables a una determinada clase de Cuenta, las Cuentas no tendrn un trmino fijo, y en consecuencia, el Banco o el Depositante podrn darlas por terminado en cualquier momento, sin aviso previo, y sin necesidad de que medie causa justa para ello. El Banco por este Contrato se reserva el derecho, a su discrecin, a cerrar la Cuenta en cualquier momento. En caso que la Cuenta se cierre, el Banco enviar notificacin al Depositante y le enviar un cheque por el balance de la Cuenta, despus de haber deducido las comisiones respectivas, as como cualquier saldo adeudado a favor del Banco segn sus libros, a la ltima direccin que est en nuestros archivos. El Depositante ser responsable por las transacciones iniciados antes del cierre de la Cuenta. Sin limitar de ninguna manera la generalidad de lo anterior, cualquier Cuenta que mantenga un balance de cero (0) por un periodo de sesenta (60) das puede ser cerrada por el Banco o cualquier Cuenta en la cual tres (3) cheques o ms han sido devueltos por insuficiencia de fondos puede ser terminada sin notificacin alguna a usted.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">7. FORMAS DE PROPIEDAD.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Cliente acuerda entregar a el Banco toda la documentacin necesaria para establecer la capacidad del Cliente para abrir una Cuenta en particular y proveer a el Banco con toda la informacin requerida en relacin con el cumplimiento de las leyes y polticas para la prevencin del blanqueo de capitales y financiamiento del terrorismo, as como de las polticas en materia de transparencia tributaria.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. Cuentas Individuales.Una Cuenta Individual es una Cuenta de depsito cuyo dueo es una sola persona natural.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Cuentas Colectiva O (expresin O). Una Cuenta Colectiva O es una Cuenta de depsito cuya propiedad pertenece a dos o ms personas naturales bajo la condicin de titularidad O, segn lo previsto en la ley 42 de1984. Usted acuerda que si la cuenta fue abierta por dos o ms personas es una Cuenta Colectiva O a menos que usted le haya dado a el Banco instrucciones contrarias. Si esta es una Cuenta Colectiva O, usted acuerda que la expresin O en la Cuenta para designar la relacin entre las personas a cuyo nombre est la Cuenta, har entender que cada una de ellas es duea de la totalidad de la cuenta, y en consecuencia; (i) la firma de cualquiera de ellas es suficiente para retirar fondos, ordenar pagos, cerrar la cuenta, revocar o suspender retiros de fondos y rdenes de pago, ceder o gravar los derechos derivados de la Cuenta y lo dems que acuerden el Banco y los Titulares; (ii) Cada uno de los Titulares responder por la totalidad de la cuenta en caso de sobregiro o saldo deudor, y cargo de la Cuenta por la cantidad debida al Banco; (iii) la orden de embargo, secuestro, suspensin o retencin de pagos decretada por autoridad competente sobre los fondos de cualquiera de los titulares recae sobre la totalidad de la Cuenta hasta la concurrencia de la suma indicada en la orden; (iv) la muerte o declaracin judicial de ausencia, presuncin de muerte, interdiccin, quiebra o concurso de acreedores de cualquiera de los titulares no afecta el derecho de giro ni el de propiedad del o de los otros titulares sobre la Cuenta. Adicionalmente, los titulares y el Banco acuerdan que la firma de cualquiera de los titulares ser suficiente para retirar o eliminar a otro titular o titulares de la Cuenta, as como para adicionar uno o ms titulares a la Cuenta. Cada Titular de la Cuenta puede aprobar estados de cuenta, puede obtener informacin en relacin con la Cuenta. Sin perjuicio de los acuerdos que pudieran existir entre los Titulares de la Cuenta, el Banco no ser responsable por los daos y perjuicios que pudieran derivar del cumplimiento de las instrucciones en la forma antes prescrita. El Banco podr abstenerse de atender instrucciones respecto de la Cuenta, cuando haya recibido instrucciones contradictorias o incompatibles de dos o ms titulares, respecto de la Cuenta. El Banco se reserva el derecho a determinar razonablemente a su opcin y exclusivo criterio, bajo qu circunstancias las instrucciones recibidas respecto de la Cuenta poseen carcter incompatible o contradictorio, en cuyo caso proceder a notificarlo a los Titulares. El Banco no ser responsable por los daos y perjuicios ocasionados con el ejercicio de esta facultad. Sin perjuicio de lo anterior, y aunque el Banco no tiene la obligacin de notificar a ninguna persona de cualquier cambio u otra accin en relacin con la Cuenta hecha por alguno de ustedes, el Banco puede, requerir la firma de todos ustedes para pagar algn tem o tomar alguna accin en relacin con la Cuenta, si el Banco ha recibido rdenes contradictorias de cualquiera dos o ms de ustedes, ha recibido una orden firmada por no todos ustedes buscando cambiar la titularidad de la Cuenta (o restringir el pago o la transferencia de fondos), o ha concluido por cualquier otra razn, a discrecin del Banco, que es prudente requerir las firmas de todos ustedes.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Cuentas Conjuntas Y (expresin Y). Una Cuenta Conjunta Y es la que est a nombre de dos o ms personas naturales bajo la condicin de titularidad y o y/o segn lo previsto en la ley 42 de1984. Si esta es una Cuenta Conjunta Y bajo la condicin de titularidad Y, usted acuerda que la expresin Y en la Cuenta para designar la relacin entre las personas a cuyo nombre est la Cuenta, har entender que (i) los titulares son acreedores mancomunados del Banco y deudores solidarios del mismo, en caso de sobregiro, saldo deudor, o cargos de la Cuenta por la cantidad debida al Banco por dichos conceptos; (ii) la firma de todos los titulares se requiere para retirar fondos, ordenar pagos, cerrar la cuenta, revocar o suspender retiros de fondos y rdenes de pago, ceder o gravar los derechos derivados de la Cuenta y los dems que los Titulares y el Banco acuerden; (iii) la orden de embargo, secuestro, suspensin o retencin de pagos decretada por la autoridad competente sobre los fondos de uno o ms de los titulares en dicha Cuenta, slo recae sobre la parte alcuota que le corresponde al afectado por dicha orden hasta el momento de la suma indicada en la misma. El saldo de la parte alcuota no afectado por la orden, si lo hubiera, as como la parte alcuota de los titulares no afectados por la mencionada orden, sigue las normas detalladas en las secciones (i) (ii) y (iv). Si la orden recayere sobre la totalidad de la parte alcuota, la firma del o de los titulares afectados por la misma no ser necesaria para las operaciones a que se refiere la seccin (ii) anterior, mientras subsista dicha orden; (iv) la muerte o declaracin judicial de ausencia, presuncin de muerte, interdiccin, quiebra o concurso de acreedores o la liquidacin de uno o ms de los titulares, slo afecta la parte alcuota del o de los titulares de que se trate, la cual ser retenida por el Banco a nombre de o de los titulares respectivos. En estos casos la firma del o de los titulares tampoco ser necesaria para las operaciones a que se refiere la seccin (ii) anterior, mientras subsista dicha situacin. Si esta es una Cuenta Conjunta Y bajo la condicin de titularidad y/o, usted acuerda que la expresin y/o en la Cuenta para designar la relacin entre las personas a cuyo nombre est la Cuenta, har entender lo mismo que la expresin ysegn lo indicado anteriormente, salvo que la firma de cualquiera de los titulares ser suficiente para retirar fondos, ordenar pagos, cerrar la cuenta, revocar o suspender retiros de fondos y rdenes de pago, y ceder o gravar los derechos de la cuenta. Adicionalmente, los titulares y el Banco acuerdan que la firma de cualquiera de los titulares ser suficiente para retirar o eliminar a otro titular o titulares de la Cuenta, as como para adicionar uno o ms titulares a la Cuenta. El Banco no tiene obligacin de informar al o a los titulares sobre las instrucciones dadas por algn titular respecto de la Cuenta. Sin perjuicio de los acuerdos que pudieran existir entre los Titulares de la Cuenta, el Banco no ser responsable por los daos y perjuicios que pudieran derivar del cumplimiento de las instrucciones en la forma antes prescrita respecto de las cuentas y/o. El Banco podr abstenerse de atender instrucciones respecto de la Cuenta bajo la condicin de titularidad y/o, cuando haya recibido instrucciones contradictorias o incompatibles de dos o ms titulares, respecto de la Cuenta. El Banco se reserva el derecho a determinar razonablemente a su opcin y exclusivo criterio, bajo qu circunstancias las instrucciones recibidas respecto de la Cuenta poseen carcter incompatible o contradictorio, en cuyo caso proceder a notificarlo a los Titulares. El Banco no ser responsable por los daos y perjuicios ocasionados con el ejercicio de esta facultad. Indistintamente, se trate de una cuenta bajo la titularidad y o y/o cualquiera de los titulares podr solicitar informacin sobre la Cuenta, sin necesidad de requerir la firma del o de los dems titulares, y sin necesidad de notificarles sobre la solicitud o sobre la informacin entregada con motivo de la misma.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">D. Cuentas con Beneficiarios. El Depositante podr solicitar al Banco que en caso de fallecimiento, el sado de la Cuenta sea pagado por el Banco directamente y sin ningn otro trmite o procedimiento judicial, a la persona o personas designadas por el Depositante como beneficiario o beneficiarios, o a su custodio, tutor o representante legal debidamente acreditado, segn sea el caso. Para tal efecto el Depositante deber hacer la designacin del o de los beneficiarios, siguiendo las formalidades y procedimientos que el Banco determine. El pago a favor del o de los beneficiarios se realizar una vez identificado debidamente el beneficiario y comprobada la muerte del Depositante, para cuyos efectos el Banco podr exigir el cumplimiento de aquellas formalidades que estime conveniente. Queda entendido que los beneficiarios no tienen facultades de disposicin sobre la Cuenta, ni tampoco derecho a recibir informacin sobre la Cuenta. Los beneficiarios tienen derecho a recibir los saldos de la Cuenta, en las proporciones establecidas por el o los titulares, sin perjuicio de los derechos que correspondan a los titulares de cuentas conjuntas o comunes, segn la condicin de titularidad de la Cuenta; y sin perjuicio de los derechos de prenda, compensacin y dems que pueda tener el Banco sobre la Cuenta. Si el beneficiario muere (o, si hay ms de un beneficiario, todos mueren) antes de la muerte del ltimo de los Depositantes entonces la caracterstica mencionada de Cuenta con Beneficiario se terminar dejar de tener efecto automticamente y la Cuenta corresponder a quien sea declarado heredero dentro del proceso de sucesin del ltimo Depositante; salvo que se designen nuevos beneficiarios. Si ms de un beneficiario es nombrado, slo esos beneficiarios que estn vivos al momento de la muerte del ltimo de los Depositantes tendrn derecho a recibir los saldos de la Cuenta. Si ms de un beneficiario sobrevive al ltimo Depositante, cada uno de esos beneficiarios tendr derecho a recibir el saldo de la Cuenta en la proporcin que le corresponda segn las instrucciones del Depositante. Si habiendo sido designados varios beneficiarios, al momento de la entrega del saldo de la Cuenta alguno o algunos de ellos (no todos) hayan fallecido, los fondos que le hubiesen correspondido al o a los beneficiarios fallecidos sern repartidos en parte iguales entre los beneficiarios sobrevivientes, o entregado en su totalidad al beneficiario sobreviviente, segn sea el caso.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">E. Cuenta Corporativa. Cuentas Corporativas pueden ser abiertas bajo el nombre de una corporacin o entidad legal similar. Una Cuenta corporativa podr ser abierta mediante el cumplimiento con los requisitos establecidos por el Banco y la entrega de todos los documentos requeridos por el Banco, incluyendo la entrega de los documentos de organizacin de la entidad legal, la debida autorizacin de la junta de directores u rgano directivo similar de la entidad legal, en el formato requerido por el Banco y la designacin de las Firmas Autorizadas por la entidad legal a manejar la Cuenta Corporativa. Una vez se active la Cuenta Corporativa, y sujeto a las limitaciones aplicables a las designaciones de Firmas Autorizadas de la corporacin o entidad legal similar notificadas al Banco, las Firmas Autorizadas pueden solicitar al Banco todas aquellas gestiones para las cuales este autorizado conforme a su designacin, incluyendo, pero sin limitarse a, el pago y el dbito de la Cuenta Corporativa, cualquiera y todas las notas, u otras rdenes para debitar la Cuenta o que han sido entregadas al Banco para transferir o retirar fondos de la Cuenta Corporativa, la modificacin o cancelacin de la Cuenta Corporativa.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">8. CLASES DE CUENTAS.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco ofrece una variedad de cuentas a personas naturales y jurdicas.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. Cuentas Corriente No Remuneradas. Son cuentas corrientes con chequera, que no genera rentabilidad y permiten realizar pagos y transferencias de manera ilimitada. El Banco requiere un monto mnimo para su apertura, y el mantenimiento de un saldo promedio mnimo en la Cuenta; el Banco cobrar una comisin cuando la Cuenta tenga un saldo promedio inferior al requerido. La cuenta no posee una duracin limitada, por lo tanto podr ser cancelada por cualquiera de las partes, cuando as se determine, si usted decide cancelar la cuenta antes de los seis (6) meses posteriores a la apertura de la misma, el Banco tendr la facultad de cobrarle una comisin por cancelacin anticipada.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Cuentas Corriente Remuneradas. Son cuentas corrientes con chequera, que generan rentabilidad y permiten realizar un nmero limitado de pagos y transferencias. El Banco requiere un monto mnimo para su apertura y el mantenimiento de un saldo promedio mnimo; el Banco cobrar una comisin cuando la Cuenta tenga un saldo promedio inferior al requerido. Igualmente, el Banco cobrar una comisin en el evento de que se realicen pagos o transferencias en exceso a la cantidad permitida. El inters que se paga sobre las Cuentas puede variar dependiendo de las condiciones del mercado. El Banco se reserva el derecho de, a su sola discrecin, cambiar el inters pagado sobre las Cuentas. La cuenta no posee una duracin limitada, por lo tantopodr ser cancelada por cualquiera de las partes, cuando as se determine, si usted decide cancelar la cuenta antes de los seis (6) meses posteriores a la apertura de la misma, el Banco tendr la facultad de cobrarle una comisin por cancelacin anticipada.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Cuentas Ahorros. Son cuentas de depsito a la vista remuneradas. El Banco requiere un monto mnimo para su apertura y el mantenimiento de un saldo promedio mnimo; el banco cobrar una comisin cuando la Cuenta tenga un saldo promedio inferior al requerido. El inters que se paga sobre las Cuentas puede variar dependiendo de las condiciones del mercado. El Banco se reserva el derecho de, a su sola discrecin, cambiar el inters pagado sobre las Cuentas. La cuenta no posee una duracin limitada, por lo tanto podr ser cancelada por cualquiera de las partes, cuando as se determine, si usted decide cancelar la cuenta antes de los seis (6) meses posteriores a la apertura de la misma, el Banco tendr la facultad de cobrarle una comisin por cancelacin anticipada.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">D. Depsitos a Plazo. Son depsitos a trmino remunerados. El Banco a su entera discrecin, determinar la tasa de inters aplicable segn las condiciones prevalentes en el mercado (y segn la cantidad y el trmino del depsito) al tiempo que el depsito fue originalmente realizado y al momento en el cual el depsito es renovado. La tasa de inters as determinada no podr se variada durante el tiempo de vigencia del Depsito, con excepcin de los Depsitos Tasa Variable, cuya tasa de inters est indexada a una tasa de referencia. El Banco se reserva el derecho a establecer la fecha valor de cada depsito, ya sea constituido mediante cheques, transferencias, o cualquier otra forma que El Banco determine, y ser a partir de dicha fecha cuando el Depsito empezar a devengar intereses. Al momento de la apertura del Depsito a plazo, usted puede solicitar al Banco la impresin de una constancia de inversin en la cual constan las caractersticas principales del producto y sus titulares, en ningn momento dicha constancia de inversin debe entenderse como un certificado negociable. El Depsito podr ser cedido a otro u otros titulares, solicitndolo Salvo que el Banco y el Depositante acuerden otra cosa, los intereses devengados por el Depsito se acumularn al capital en cada fecha de vencimiento. Los Depsitos a Plazo que no sean renovados, dejarn de devengar intereses a partir de la fecha de vencimiento, y los fondos sern puestos a disposicin del Depositante. El Depsito a Plazo no podr incrementarse antes de su vencimiento, salvo acuerdo entre el Banco y el Depositante, mediante capitalizacin de intereses o nuevos aportes. Los retiros o cancelaciones anticipados del Depsito a Plazo sern permitidos solamente en virtud de una orden de autoridad competente, o en el evento de que el Depsito a Plazo estuviere pignorada a favor de un Banco y la garanta fuere ejecutada en todo o en parte en virtud del incumplimiento de la obligacin garantizada; o si el Banco, en su absoluta discrecin le autoriza tales retiros o cancelacin anticipada, en cuyo caso ser solamente permitido bajo los trminos que el Banco determine y una vez usted haya realizado una solicitud de cancelacin por escrito al Banco, dicha solicitud debe realizarse 10 das antes de la fecha en la que se desea la disponibilidad de los fondos. Queda entendido que si bien el Banco puede autorizar el retiro o cancelacin anticipada del Depsito a Plazo, no significa que est obligado a hacerlo. En el evento en que el Banco autorice el retiro o cancelacin anticipada del Depsito, la cancelacin debe ser por el total del valor del Depsito y queda facultado para cobrar un buen valor, el cual es el resultado del ajuste retroactivo de la tasa del Depsito, teniendo en cuenta los costos financieros en que el banco deba incurrir, derivados de dicha cancelacin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">9. MUERTE DELDEPOSITANTE.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Si cualquiera de los dueos de la Cuenta muere, nosotros debemos recibir una copia autenticada de la partida de defuncin o cualquier otro documento que a nuestra discrecin puede ser necesario para establecer la muerte del dueo. Hasta tanto el Banco sea notificado sobre la muerte del dueo de la Cuenta, en la forma antes prescrita, el Banco no ser responsable frente a los beneficiarios, sucesores o herederos o frente a cualquier tercero, por la ejecucin de instrucciones indebidas o fraudulentas impartidas sobre la Cuenta por Personas Autorizadas, mandatarios, o representantes legales. Acreditada a satisfaccin del Banco la muerte del titular de la Cuenta, se proceder a entregar el saldo de la Cuenta o la parte alcuota de este, segn la condicin de titularidad de la Cuenta, a favor del o de los beneficiarios designados, de haber alguno, en las proporciones que corresponda; o a favor de aquellas personas que hayan sido declaradas como herederos del dueo, segn las instrucciones recibidas al efecto por los tribunales panameos dictadas dentro del proceso de sucesin correspondiente, en caso de que no existan beneficiarios designados y sobrevivientes a la muerte del dueo de la Cuenta. Sin embargo, usted acuerda que no tendremos obligacin de desembolsar tal balance o una parte del mismo o cualquier otro activo del causante, a menos y hasta que nosotros estemos completamente satisfechos, segn nuestro propio juicio, que no tendremos ninguna responsabilidad actual o potencial por dicha entrega bajo las leyes de la Repblica de Panam .</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">10. CERTIFICACIN DE CONDICIN DE NO CONTRIBUYENTE.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Cada Depositante de la Cuenta que sea una persona natural deber certificar su condicin de no residente o domiciliado en la Repblica de Panam, mediante la presentacin de aquellos documentos que el Banco considere necesarios para acreditar dicha condicin. Cada Depositante de la Cuenta que sea una persona jurdica, independientemente del lugar de su domicilio o constitucin, deber certificar que no genera ingresos gravables en la Repblica de Panam, mediante la presentacin de aquellos documentos que el Banco considere necesarios para acreditar dicha condicin. Adicionalmente, el Banco podr requerir a cada Depositante, Persona Autorizada o cualquier otra relacionada con la Cuenta que certifique si es una persona residente de los Estados Unidos de Amrica para efectos tributarios, o en el caso de personas jurdicas, si es de propiedad sustancial de personas que sean residentes de los Estados Unidos de Amrica para efectos tributarios. Sin perjuicio de cualquier informacin o documentacin adicional que el Banco estime conveniente solicitar para acreditar la condicin de residente de los Estados Unidos de Amrica del Depositante o de sus propietarios sustanciales, el estatus de no residente de los Estados Unidos se acreditar entregando a el Banco la Forma W-8BEN expedida por el Departamento Interno de Rentas; y, el estatus de residente de los Estados Unidos se acreditar entregado al Banco la Forma W-9 expedida por el Departamento Interno de Rentas, donde conste el nmero de identificacin tributario. Alternativamente, las certificaciones mencionadas arriba pueden ser entregadas en alguna forma similar a la Forma W-8BEN o a la Forma W-9, segn sea el caso. La certificacin del Depositante que no es un residente en los Estados Unidos debe de ser renovada antes del ltimo da del tercer ao calendario siguiente a la fecha en que la certificacin fue firmada, o con la periodicidad que el Banco determine de tiempo en tiempo. El Banco queda por este medio plenamente autorizado para cerrar una Cuenta o rehusar cualquier transaccin a o de la Cuenta o aplicar retenciones sobre la Cuenta, si la certificacin no consta en los registros del Banco, o no son renovadas a tiempo. Si el Depositante que ha certificado su estatus de no residente de los Estados Unidos al tiempo que l o ella abren la Cuenta con el Banco y despus dicha persona llega a ser un ciudadano de los Estados Unidos, o llega a ser un residente fiscal o para efectos de tributarios en los Estados Unidos, debe de certificar por escrito al Banco dentro de los treinta (30) das siguientes al cambio de status, en la forma entregada por el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">11. FIRMAS AUTORIZADAS.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco tendr el derecho de confiar en la firma o cualquier resolucin o designacin de firmantes autorizados entregados por el Cliente en relacin con la Cuenta, hasta que el Cliente haya entregado al Banco otro documento que revoque o modifique las autorizaciones contenidas en las resoluciones o designacin de firmantes autorizados previamente entregados al Banco en relacin con la Cuenta. El Cliente exonera al Banco de cualquier responsabilidad por la ejecucin de instrucciones con base en documentos cuyas firmas hayan sido alteradas o falsificadas, salvo que medie culpa grave o dolo por parte del Banco. Cuando se trate de personas jurdicas, el Cliente est obligado a poner en conocimiento del Banco, de inmediato y por escrito, todos los acuerdos, hechos, circunstancias, o acontecimientos relativos a su personera jurdica o estructura administrativa y social, con inclusin de todo cambio o modificacin de su pacto social o estatutos, as como la integracin o estructura de sus rganos sociales, y el otorgamiento, alteracin o revocacin de poderes y mandatos, designacin y destitucin de directores, dignatario y funcionarios principales de la compaa. Es entendido que no bastar el otorgamiento, la protocolizacin, o la inscripcin del documento en la entidad pblica pertinente y/o la publicacin de tales cambios para que sean oponibles al Banco, siendo necesario que estos le sean notificados por escrito, quedando el Banco relevado de toda responsabilidad si realizara operaciones o ejecutara instrucciones con base en la informacin que conste en sus registros.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">12. RETIROS, CHEQUES YDEPOSITOS.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Esta seccin provee informacin respecto a las diferentes cuentas de depsitos y productos del Banco, inclusive de Certificados de Depsito, Cuentas con chequera, y Cuentas de Ahorros.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. Depsitos. No obstante cualquier informacin que puede ser dada al Depositante al momento de realizar el depsito o de otra manera, todos los tems recibidos por el Banco para crdito o cobro son recibidos a riesgo y cuenta del Depositante sujetos a que el Banco reciba los fondos. El Banco puede debitar la Cuenta en cualquier momento respecto a algn tem cuyo pago final no fue recibido.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco slo actuar como agente del Depositante y no asume responsabilidad mas all que la de actuar con el debido cuidado. No se considerar que el Banco ha recibido un tem enviado por correo o entregado en alguna de las oficinas de sus afiliados o corresponsales hasta que el Banco no haya efectivamente recibido dicho tem en su oficina en das hbiles y dentro de horas de oficina. El Banco puede, a su sola discrecin, rechazar un depsito, limitar la cantidad que puede ser depositada o devolver parte o todo de la cantidad depositada. tems depositados en la Cuenta del Depositante estarn disponibles para ser retirados o para otro uso por el Depositante de acuerdo con el presente Contrato, la legislacin aplicable, y los usos y costumbres bancarios. En el evento de que el Banco reciba para su depsito dinero en divisas o denominaciones distintas a la moneda de curso legal de los Estados Unidos de Amrica, proceder con la conversin de la moneda a la tasa vigente para dicha fecha en el mercado de la plaza. El Banco queda autorizado para cobrar y debitar de su Cuenta los cargos por cuenta de terceros en que haya de incurrir para la conversin de la moneda.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Tasas de Inters. El Banco se reserva el derecho, a su sola discrecin, de cambiar las tasas de inters pagadas por el Banco sobre alguna Cuenta de Depsito con inters o cualquier otra Cuenta ofrecida por el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Acreditar o Devolucin. Todos los tems cobrados por cuenta del Depositante o depositados en la Cuenta (sin importar si tales tems fueron cobrados contra dicho depsito) sern manejados por el Banco como agente del Depositante sujeto al correspondiente dbito, extorno, contra cargo o devolucin si por alguna razn el pago final no es recibido en efectivo o mediante crdito incondicional aceptado por el Banco. Igualmente, cualquier tem girado contra el Banco y cobrado por cuenta del Depositante, o depositado en la Cuenta, estar sujeto al correspondiente dbito, extorno, contra cargo o devolucin si por alguna razn dicho tem es considerado como no pagadero. Los crditos o anotaciones hechos por error a una cuenta del Depositante podrn ser anulados por el Banco mediante el correspondiente dbito o extorno. En general cualquier crdito hecho por el Banco a una Cuenta por razn de depsito de un documento es bajo la condicin de que dicho documento ser pagado a su vencimiento, y es entendido que si no es pagado en esa fecha el Banco queda autorizado para realizar el correspondiente dbito, pudiendo adems cobrar los intereses causados, an cuando el documento no pueda ser devuelto por el banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">D. Endosos. El Banco puede, a su sola opcin y discrecin, aceptar cualquier tem endosado para ser depositado en la Cuenta y dicho endoso puede ser realizado manualmente, en imprenta, por sello, o de otra manera; y dicho endoso ser considerado como legtimo en todo caso. El pago de un tem puede ser rechazado a opcin y exclusivo criterio de el Banco, si esta endosado en lpiz, o mal realizado, ilegible, o si el tem contiene doble endoso.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">E. Cheques Postdatados. En relacin con cualquier cheque postdatado girado por el Depositante, es el deber del Depositante notificar a el Banco por escrito, dando una completa descripcin del tem, incluyendo el beneficiario, la fecha, el nmero y su monto; en caso de no existir dicha notificacin por escrita, el Banco no ser responsable por pagar algn cheque postdatado antes de la fecha escrita en el cheque. Un cargo puede ser cobrado por cada tem postdatado girado por el Depositante.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">F. Cheques Caducos. El Banco no est obligado a pagar un cheque que ha sido girado respecto a la Cuenta con ms de tres (3) meses de antelacin a la fecha de su presentacin para pago al Banco. Sin embargo, el Banco podr a su opcin y exclusivo criterio, atender el pago de tales cheques con un periodo de caducidad mayor a ste.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">G. Da Laboral. Los das y horas laborales del Banco son de lunes a viernes desde las 8:00 a.m. hasta las 3:00 p.m. Los sbados, domingos y das de fiesta no son das laborales. Cheques y otros tems depositados o recibidos despus de las 3:00 p.m. en cualquier da laboral sern registrados el da laboral siguiente.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">H. Reclamos. Si algn reclamo es hecho al Banco para el reembolso de alguna parte de un tem que fue cobrado (incluyendo cualquier tem cobrado por cuenta del Depositante) despus del pago final de este, por causa que el tem fue alterado o tena una firma fraudulenta o no autorizada o no era susceptible de ser pagado en debida forma, el Banco puede retener la cantidad de ste tem de la Cuenta hasta que se emita una determinacin final sobre dicho reclamo.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">I. Actualizacin. Es obligacin del Depositante entregar informacin veraz y verificable, y actualizar su informacin por lo menos una vez al ao o cuando se produzcan cambios sustanciales en su actividad, nivel de ingresos o transacciones, suministrando la totalidad de los soportes documentales exigidos segn la Cuenta. Tal actualizacin supone el diligenciamiento de los formatos vigentes que el Banco establezca para dicho propsito. El Banco podr cerrar las Cuenta si Usted desatiende esta obligacin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">J. Cierre de Cuenta. El Depositante puede en cualquier momento cerrar alguna de las Cuentas por medio de notificacin escrita al Banco. Una vez la notificacin haya sido recibida el Banco cerrar la Cuenta inmediatamente. Al cierre de la cuenta Usted se compromete a devolver al Banco los cheques que no hubiere utilizado, y si as no lo hiciere, responder al Banco de todos los perjuicios que ocasione la utilizacin indebida de los cheques no devueltos.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Teniendo en cuenta lo anterior, el Banco se reserva el derecho de continuar pagando cheques que sigan siendo presentados para su pago contra la Cuenta cerrada. Usted continuar siendo responsable de cualquier cargo por los servicios y transacciones iniciadas antes del cierre de la Cuenta o que se originan por el cierre de la Cuenta.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">K. Cuentas Inactivas. Para la clasificacin y tratamiento de las cuentas inactivas se estar a lo dispuesto para tal efecto en la legislacin panamea. No obstante lo anterior se considerar una Cuenta como inactiva cuando no se realicen sobre la misma, depsitos o retiros por orden del Depositante por un periodo consecutivo de cinco (5) aos, y se ignore el paradero del Depositante, luego de haber realizado intentos fehacientes de localizarlo. En el caso de Cuentas de Depsito a Plazo Fijo, se entender que existe inactividad cuando la Cuenta haya sido renovada automticamente por cinco (5) periodos consecutivos, y se ignore el paradero del Depositante, luego de haber realizado intentos fehacientes de localizarlo. Las Cuentas clasificadas como inactivas, estarn sujetas a las comisiones por inactividad vigentes de tiempo en tiempo, adems de cualquier otra comisin aplicable a la Cuenta. Las Cuentas clasificadas como inactivas devengarn intereses que correspondan segn el tipo de Cuenta de que se trate. De conformidad con la legislacin vigente el Banco estar obligado a entregar al Banco Nacional de Panam o aquella entidad designada por ley de tiempo en tiempo, cualquier fondo mantenido en una Cuenta clasificada como inactiva.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">L. Poder Especial. Usted puede autorizar otra persona por escrito y en una forma aceptable al Banco, para que acte en su nombre y representacin y realice operaciones sobre la Cuenta. Sin limitar la generalidad de lo anterior, el Banco a su sola discrecin puede o no aceptar el poder especial que usted pretende utilizar para abrir o cerrar una Cuenta o para depositar o retirar fondos de la Cuenta o para endosar cheques o cualquier otro tem.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">M. Orden de no Pago. El Banco requiere que todos las rdenes de no pago sean recibidas por el Banco por escrito o por cualquier otro medio autorizado por el Banco, siempre y cuando exista absoluta identidad entre los elementos del cheque y los datos suministrados por Usted; y siempre que reciba la instruccin antes de que el cheque haya sido presentado para su cobro o antes de haberlo certificado, segn sea el caso. Todas las rdenes de no pago sern efectivas por un lapso de tres (3) meses, pero en ningn caso sern por ms de tres (3) contados a partir de la fecha del cheque. La orden de no pago debe incluir la fecha de la orden, el nmero del cheque, la fecha del cheque, nombre del beneficiario, nombre del depositante, cantidad, y naturaleza de la orden. Nuestra responsabilidad por aceptar la orden de no pago es limitada a lo que ordena la ley. El Banco atender las rdenes de no pago emitidas por autoridad competente. Nosotros no aceptamos una orden de no pago de un cheque que est siendo procesado al tiempo que la orden de no pago es recibida. Por el hecho de hacer una orden de no pago, usted acuerda a lo siguiente:</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(i) rembolsar al Banco por cualquier prdida que resulte del no pago de un cheque o de una orden de pago;</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(ii) cancelar la orden de no pago prontamente por escrito si el cheque o la orden de pago es destruida o de otra manera esta fuera de circulacin;</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(iii) notificar al Banco antes que usted emita un cheque u orden de pago de reemplazo;</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(iv) escribir en la parte del frente de dicho cheque la palabra reemplazo y un nmero y fecha diferente del cheque emitido originalmente.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Depositante acuerda no hacer responsable a el Banco si un cheque respecto del cual se haya emitido una orden de no pago es pagado o si el cheque emitido en su reemplazo no es pagado debido a mala identificacin por parte de Ustedes siempre que el Banco haya seguido sus procedimientos internos.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Depositante acuerda que el Banco no aceptar una orden de no pago de un cheque certificado hasta que noventa (90) das hayan pasado desde la fecha de certificacin, y slo si el Depositante entrega una certificacin y acuerdo indemnizatorio para efectos que el cheque fue perdido, robado, o que no pudo ser encontrado.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">N. Informacin Extraa. El Banco puede, en su discrecin, desconocer cualquier informacin en el cheque presentado para ser pagado contra la Cuenta que no sea la firma de los giradores, la identificacin del banco pagador, el beneficiario, la cantidad, la fecha e informacin que aparece en la lnea MICR. El Depositante acuerda ser responsable por los daos sufridos por el Banco como resultado de alguna otra informacin escrita en el frente o al reverso del cheque.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">O. Fondos Insuficientes. Si no hay fondos suficientes en la Cuenta o si los fondos suficientes no estn disponibles para retiro cuando un tem es presentado para ser pagado, el Banco puede, pero no est obligado, a pagar el tem y crear un sobregiro sin notificarle previamente. Usted acuerda depositar fondos suficientes para cubrir el sobregiro tan pronto como sea posible despus que el Banco le informe a usted del sobregiro. Usted acuerda que una comisin le ser cobrada, y que el Banco se reserva el derecho a cobrar inters a la tarifa vigente para el servicio de sobregiro hasta que el sobregiro haya sido pagado completamente. En caso que sea necesario para proveer al Banco con los fondos necesarios para pagar el cheque presentado para su pago en alguna Cuenta de ustedes, o fondos para cubrir un sobregiro en una Cuenta de ustedes (y el inters sobre dicho sobregiro), el Banco puede, en su sola discrecin, transferir fondos de una Cuenta de ustedes a otra Cuenta de ustedes, sin importar si tales Cuentas estn a nombre individual o conjunta, y sin importar si es una cuenta de depsito o de certificado de depsito; sin embargo, si no hay acuerdo especfico por escrito, el Banco no tiene obligacin de hacer lo anterior.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">P. Estados de Cuenta. El Cliente recibir estados de cuenta mensuales detallando toda la actividad en la Cuenta. Si el Cliente cree que el estado de cuenta contiene un error o discrepancia, entonces el Cliente debe notificar al Banco por escrito dentro de los treinta (30) das siguientes de la fecha del estado de cuenta que contiene el error o discrepancia; de otra manera, se concluir que el Cliente est de acuerdo con y acepta el estado de cuenta. En consecuencia, el Cliente no tendr el derecho de reclamar contra el Banco que la firma no es autorizada o que est alterada en algn tem que fue pagado por el Banco (y pagado antes que el Banco haya recibido notificacin de lo incorrecto), si la persona que hizo la firma no autorizada o alteracin tambin es responsable por la discrepancia y que el Cliente no report a tiempo a el Banco. Los estados de cuenta sern enviados a la ltima direccin conocida por el Banco o a otra direccin que el Cliente haya designado por escrito a el Banco; sin embargo, si algn estado de cuenta es devuelto a el Banco con un sello de no entregado, el Banco puede suspender el envo de los estados de cuenta hasta que el Cliente rectifique la direccin, y su Cuenta puede ser debitada por una comisin por el manejo y conservacin de la correspondencia que no ha sido entregada. En esas situaciones, cada estado de cuenta ser considerado como disponible y recibido por el Cliente en la fecha que est en el estado de cuenta. Si algn estado de cuenta no ha sido recibido por el Cliente a tiempo, el Cliente debe notificar al Banco de esto tan pronto como sea posible y en ningn caso ms tarde de treinta (30) das contados a partir de la fecha que tal estado de cuenta es recibido normalmente por el Cliente (o recibido por su apoderado). El Banco podr de tiempo en tiempo modificar los estados de cuenta y podr para estos efectos utilizar cualquier medio tecnolgico de informacin que se implemente para su emisin. Usted podr solicitar en cualquier momento al Banco un estado de cuenta distinto al estado de cuenta emitido ordinariamente por el Banco. En estos casos el Banco cobrar a Ustedes una comisin por la emisin de dichos estados de cuenta.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Q. Orden de Cheques y Comisiones. El Banco suministrar a Usted, previa solicitud escrita, la libreta de cheques que usted requiera para hacer giros contra la Cuenta. Si Usted quisiera confeccionar sus propios cheques deber obtener la autorizacin del Banco y suscribir un convenio especial para la utilizacin de tales cheques. El Banco podr cobrar una comisin por la impresin de cheques. Igualmente, el Banco queda autorizado para aplicar los cargos por cuenta de terceros que correspondan para el pago del impuesto de timbre aplicable a los cheques, de conformidad con la legislacin vigente. Las comisiones y cargos aplicables sern deducidas del balance de la Cuenta. Un recibo de confirmacin enviado con la libreta de cheques debe de ser debidamente firmado y devuelto a el Banco. El Banco podr rehusar el pago de cheques extendidos que no sean de los impresos o autorizados por el Banco. Usted deber dar aviso al Banco de la prdida o extravo de sus cheques o libreta de cheques. En caso de omitir este aviso, Usted ser responsable de los perjuicios que puedan resultar.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco tambin se encargar de coordinar la impresin de los comprobantes de depsito, peticiones de rdenes de no pago y otras formas que sean necesarias para la operacin de la Cuenta, y el Banco no aceptar ninguna otra forma en relacin con la operacin de la Cuenta (a menos que el Banco, en su absoluta discrecin, haya acordado previamente por escrito con usted una forma diferente).</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">R. Secciones Adicionales Respecto a Cheques y Depsitos. El Banco no ser responsable por ningn error, negligencia, falta, mala conducta o insolvencia de parte del agente seleccionado por el Banco, o alguno de los subagentes seleccionados por los agentes, todos los cuales sern considerados como agentes del Depositante. Respecto al cobro de algn cheque o tem similar, el Banco y cualquier agente de cobro pueden aceptar las notas o crditos de cualquier agencia, banco pagador, o pagador en lugar de dinero en efectivo. Si el pago de algn cheque o tem similar excede el balance disponible en cualquiera de las Cuentas de usted o excede el sobregiro autorizado, el Banco rechazar tal pago. El Banco no tiene la obligacin de aceptar ninguna leyenda que est en algn cheque firmado, aceptado o girado por usted. Usted tiene que ejercer en todo tiempo cuidado razonable para prevenir que libros de cheques o cheques en blanco lleguen a caer en manos de personas no autorizadas por usted y de prevenir alguna orden, cheque o tem similar de ser alterado, perdido o falsificado. Usted debe inmediatamente reportar a el Banco por escrito, por telefax o correo rpido, el robo, prdida o alteracin de algn cheque o libro de cheques. Usted se compromete a firmar los cheques con autgrafo idntico al registrado en las tarjetas de firma correspondientes. Para efectos del reconocimiento de autgrafos registrados, en casos de fraude o falsificacin, el Banco nicamente ser responsable en el evento de que las firmas hubiesen sido tan notoriamente falsificadas que no se requiera de conocimientos especiales para reparar en su falsificacin. El Banco podr cobrar las comisiones vigentes cuando un cheque abonado a la Cuenta sea devuelto o rechazado por el Banco librado.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">S. Servicio de Sucursal Virtual. Podrn utilizar el servicio de sucursal virtual los Clientes que soliciten y se les haya habilitado el canal Sucursal Virtual Personas o Empresas Entidades del Exterior</span></font> <font size="3"><span lang="es-AR"><b>Grupo Acacia</b></span></font><font size="3"><span lang="es-AR">conforme al procedimiento establecido por el Banco. El Depositante, para acceder al Servicio de Sucursal Virtual, deber identificarse utilizando, adems del ingreso del usuario y la clave, las dems seguridades adicionales implementadas por el Banco tales como: teclado virtual y/o, identidad protegida y/o seguridades adicionales que se llegaren a establecer, las cuales son personales e intransferibles y debern ser utilizadas nicamente por el Cliente. El Cliente acepta y reconoce que el canal Sucursal Virtual Personas o Empresas Entidades del Exterior</span></font> <font size="3"><span lang="es-AR"><b>Grupo Acacia</b></span></font><font size="3"><span lang="es-AR">, le otorgar acceso a la informacin de sus productos y servicios contratados con todas las entidades afiliadas que pertenecen o llegaren a pertenecer al</span></font> <font size="3"><span lang="es-AR"><b>Grupo Acacia</b></span></font><font size="3"><span lang="es-AR">ubicadas en el exterior.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco provee a sus Clientes el beneficio de acceso virtual a su Cuenta con el Banco. El Cliente puede realizar gestiones, transacciones y/o negocios con el Banco o con cualquiera de sus afiliadas utilizando un nombre de usuario y una clave para tener acceso al servicio de banca sucursal virtual del Banco. La clave es la firma electrnica del Cliente mientras est realizando transacciones electrnicas con el Banco. El Cliente tiene la obligacin de mantener su clave en absoluto secreto, previniendo su uso por terceras personas. En consecuencia, el Cliente acuerda mantener al Banco libre de todo reclamo, prdidas, obligaciones y gastos de cualquier clase, que resulten del uso de la clave por personas no autorizadas. Utilizando la clave segn los trminos y condiciones de este Contrato, el Cliente tendr acceso a todas las transacciones electrnicas que el Banco ha puesto a disposicin del Cliente como solicitud de balances, transferencia de fondos, realizacin de pagos, cancelar rdenes, y revisar contra rdenes, entre otros. El Cliente acepta como evidencia vlida los registros magnticos que resultan del uso de su clave para realizar negocios electrnicamente con el Banco. El Cliente aqu acuerda que las fechas de las transacciones electrnicas reportadas en los registros financieros que fueron internamente preparados por el Banco o cualquiera de sus afiliadas son ciertos y correctos.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Cliente mantendr al Banco libre de toda responsabilidad que resulte de fallas ocasionales en el equipo, malas conexiones, problemas tcnicos, suspensin del servicio, y en general por cualquier circunstancia que impida al Cliente utilizar el servicio de sucursal virtual del Banco. El Cliente no tendr derecho a ser compensado por el Banco como resultado de la cancelacin o la suspensin del servicio de sucursal virtual del Banco. El Banco puede imponer y deducir automticamente de la Cuenta del Cliente, tarifas y cualquier otro cargo que resulte de realizar negocios electrnicamente con el Banco, tal como aparece en la Tabla de Productos y Tarifas. Sujeto a los trminos del Reglamento Sucursal Virtual aplicable, el Cliente puede autorizar, a su propio riesgo, a otra persona a acceder y a realizar transacciones electrnicas en la Cuenta del Cliente reconociendo el contrato correspondiente y obteniendo otra clave sujeto a los requisitos del Banco. El Cliente aceptar como vlidas las operaciones electrnicas realizadas por la persona autorizada bajo la nueva clave. El Cliente puede revocar la autorizacin concedida a otra persona por medio de notificacin escrita al Banco. Dicha revocacin tendr efecto despus de 24 horas desde que el Banco reciba la notificacin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Si hay algn reclamo en relacin con transacciones electrnicas realizadas en su Cuenta, el Cliente deber mencionar tales reclamos dentro de los treinta (30) das siguientes a la fecha de la transaccin cuestionada, a menos que la transaccin sea una Orden de Pago sujeta a una fecha especfica diferente. Los trminos y condiciones establecidos aqu tendrn validez y se harn cumplir siempre y cuando el Cliente realice transacciones electrnicas utilizando su clave. Esta seccin no regula los trminos especficos del servicio de sucursal virtual. Tales acuerdos, si existen, sern parte de un contrato separado.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">13. TRANSFERENCIAS PROGRAMADAS</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Con la firma y presentacin del formato de solicitud de Transferencias Programadas, usted acepta los siguientes trminos y condiciones para el manejo de dichas transferencias con el Banco. Usted autoriza incondicionalmente al Banco para debitar de su Cuenta Corriente o de Ahorros a travs de cualquier otro medio de pago habilitado por el Banco y aceptado por usted, el valor inscrito correspondiente a los pagos peridicos determinados por usted. Usted se compromete a tener los fondos suficientes en sus cuentas o a mantener la disponibilidad de cupo, en cada caso, para cubrir el valor facturado el da de cobro.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco se encuentra autorizado para entregar la suma debitada al destinatario del pago designado por el usuario. El Banco no asume responsabilidad en el evento de que la cuenta sea conjunta Y y la solicitud no estuviere suscrita por todos los titulares. El Banco cargar el valor facturado en las cuentas siempre que no se implique rebajar el saldo disponible. As mismo, el Banco podr debitar de la cuenta en una fecha diferente a la indicada en aquellos casos en los que el Banco tenga inconveniente de ndole tcnico u operativo que no permitan debitar de la cuenta oportunamente. Usted acepta como prueba de las operaciones efectuadas los registros, cintas, extractos, o cualquier comprobante que se origine en virtud de las autorizaciones dadas por usted en el Banco o a terceros beneficiarios del recaudo. Usted deber notificar inmediatamente por escrito al Banco, todo cambio de direccin, telfono o dems informacin registrada en la solicitud, as como cualquier novedad, modificacin o retiro del servicio, en la oficina del Banco donde haya realizado la inscripcin del mismo.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Usted podr cancelar la autorizacin de pagos preautorizados mediante comunicacin escrita dirigida al Banco, con diez (10) das hbiles de antelacin a la fecha en la cual se va a ser efectiva. El Banco no ser responsable por el pago automtico, si la contraorden no es presentada en la forma indicada. El Banco informar de los valores debitados, a travs del extracto de su cuenta y solo atender reclamaciones por situaciones imputables a ste, en un plazo mximo de cuarenta y cinco (45) das contados desde la realizacin del pago o dbito. Si usted no dispone de cupo o fondos suficientes para cubrir el valor a debitar, el Banco no cargar el valor facturado, salvo que haya autorizado facilidad de crdito en las tasas de inters, plazo y dems condiciones vigentes al momento de su otorgamiento. El Banco no asumir ninguna responsabilidad frente a usted ni frente a terceras personas cuando se presenten inconsistencias al cargar la cuenta tales como: cuenta cancelada, cuenta saldada, cuenta en sobregiro, cuenta embargada, saldo en canje, titular fallecido o cualquier otro problema que no permita cargar el valor del Pago Preautorizado. Tampoco ser responsable por transacciones que no se puedan efectuar por problemas de lnea o de congestin, fuerza mayor, caso fortuito o cualquier otra circunstancia no imputable al Banco. El Banco puede cancelar, limitar o adicionar los presentes trminos y condiciones en cualquier momento, mediante aviso a usted dado en tal sentido por cualquier medio. Si anunciada la modificacin usted no manifiesta por escrito su decisin de excluirse de este servicio, o contina ejecutndolo, se entender que acepta incondicionalmente las modificaciones introducidas. La suspensin, limitacin o cancelacin del servicio por parte del Banco no dar lugar a ninguna reclamacin de responsabilidad o perjuicio a favor de usted. El presente servicio es de trmino. El Banco cobrar las comisiones que ste fijare por inscripcin del servicio, transaccin exitosa, transaccin fallida y por cobro del mensaje de la transferencia, las cuales sern informadas a usted por los medios establecidos por el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">14. NO TRANSFERENCIA DE CUENTA; CESIN</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Usted no puede transferir la propiedad legal o el beneficio de la Cuenta sin el consentimiento del Banco. Ninguna transferencia o cesin de la Cuenta ser vlida a menos que exista una notificacin por escrito y que sea satisfactoria para el Banco, y slo entonces en el caso que el Banco haya concedido aprobacin por escrito y que haya tenido tiempo razonable para registrar la transferencia o cesin en sus libros y registros. En general, no es la poltica del Banco permitir la transferencia y cesin de las Cuentas.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">15. LIMITACIN DE RESPONSABILIDAD; FUERZAMAYOR; FALTADE CULPAE INDEMNIZACIN</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Si el Banco recibe notificacin de alguna demanda legal, citacin, requerimiento, ejecucin, embargo, emplazamiento, notificacin, o cualquier otro procedimiento legal relacionado con (o que parece estar relacionado con) la Cuenta, (de aqu en adelante el Proceso), el Banco puede seguir (y puede confiar totalmente en) el concepto de su asesor legal referente a la respuesta apropiada a dicho Proceso, y no tendr responsabilidad ni obligacin alguna por haber seguido tal concepto, an si dicho concepto luego es considerado como incorrecto. El Banco puede cobrar a cualquier Cuenta del Depositante (sin importar si es la misma Cuenta respecto a la cual el Proceso se refiere) los gastos, incluyendo gastos de abogado, incurridos por el Banco en responder al Proceso en relacin con la Cuenta del Depositante en el Banco, y el Depositante ser responsable por el pago de tales gastos. En consecuencia, en el evento de cualquier Proceso, el Banco puede, en su sola discrecin, retener en prenda todo o parte de la Cuenta del Depositante para cubrir los gastos esperados del Banco, en dicho caso el Banco puede, sin responsabilidad alguna, devolver los cheques girados sobre la Cuenta o de otra manera rechazar el pago de cualquier retiro de la Cuenta.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">En caso de alguna disputa en relacin con alguna Cuenta de usted (sin importar si fue iniciada por usted, por el Banco, o por una tercera persona), o en el evento que el Banco reciba rdenes contradictorias, reclamos o demandas relacionadas con dicha Cuenta, el Banco puede tomar cualquier accin que el Banco o su asesor legal consideren recomendable, incluyendo sin limitacin abstenerse de ejecutar instrucciones respecto de la Cuenta hasta tanto se determine a satisfaccin cul de los demandantes tiene derecho a recibir los fondos. Todos los costos y gastos que resulten para el Banco, incluyendo sin limitacin honorarios legales (incluyendo gastos de abogados) incurridos en el juicio, o en apelacin, o gastos incurridos en caso de no haber juicio, debern ser reembolsados a el Banco por usted una vez hayan sido reclamados (y usted acuerda autorizar a el Banco a debitar alguna o todas de sus Cuentas hasta completar dicha cantidad).</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco no ser responsable ante usted por alguna falla, demora, omisin, interrupcin o error respecto de la actuacin del Banco de alguna de sus obligaciones bajo este Contrato o bajo cualquier documento que se firme con respecto a la relacin entre usted y el Banco, si los mismos resultados por cualquier causa ms all del control del Banco, incluyendo sin limitacin fallas en la energa, mal funcionamiento de equipos, suspensin en el pago por otras instituciones financieras, disputas laborales, moratoria bancaria, restricciones en la moneda, suspensin en el mercado, actos de Dios, guerras, conmociones civiles, actos de terrorismo, coaccin legal, negligencia de otra institucin financiera, y cualquier otra accin o restriccin de algn gobierno, autoridades monetarias o de supervisin, o cualquier otra tercera persona.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco y sus directores, oficiales, empleados, abogados y agentes (cada uno de los anteriores, incluyendo el Banco, siendo Parte sin Culpa) no incurrirn en ningn momento en responsabilidad para con usted (y usted expresamente renuncia y libera algn y todos los reclamos y causas de demandas que usted pueda en algn momento tener contra la Parte sin Culpa) en conexin con algn acto, omisin o circunstancias que resulten en algn momento de este Contrato, o la presentacin, pago o no pago de algn tem girado contra alguna Cuenta de usted, o la aceptacin de algn tem que ha sido depositado en alguna Cuenta, o algn proceso relacionado con (o que parezca estar relacionado) alguna de tales Cuentas, o cualquier otra cosa o transaccin contemplada por este Contrato (que no sea ningn acto que sea equivalente a culpa grave o mala conducta intencional proveniente de dicha Parte sin Culpa). Adems, el Banco y sus directores, oficiales, empleados, abogados y agentes (cada uno de los anteriores , incluyendo el Banco, siendo una Parte Indemnizada) sern en todo momento indemnizados, reembolsados y mantenidos libres de todo dao por usted (y, a peticin del Banco, sern defendidos por usted) de y contra alguna y todos los reclamos, demandas, causas de demandas, obligaciones, prdidas, daos, costos y gastos (incluyendo sin limitacin cualquier gasto de abogados, bien sea que hayan sido incurridos en juicio, apelacin, o gastos incurridos sin juicio) que pueden ser en cualquier momento impuestos sobre, incurridos o sufridos por, o alegados en contra de dicha Parte Indemnizada en conexin con algn acto, omisin o circunstancias que resulten o estn relacionadas con este Contrato, o cualquier violacin de este Contrato por usted, o la presentacin, pago o no pago de algn tem girado sobre alguna Cuenta de usted, o la aceptacin de algn tem para ser depositado en dicha Cuenta, o algn Proceso relacionado con (o que parezca estar relacionado con) cualquiera de dichas Cuentas, o alguna otra cosa o transaccin contemplada por este Contrato (que no sea ningn acto u omisin que sea equivalente a culpa grave o mala conducta intencional proveniente de dicha Parte indemnizada).</span></font></p><p style="margin-bottom: 0.14in" lang="es-AR"><br/> </p><p style="margin-bottom: 0.14in" lang="es-AR"><br/> </p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">16. CONDICIONES APLICABLES ALATRANSFERENCIAELECTRNICADE FONDOS</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Las provisiones de esta Seccin rigen todos los servicios de transferencia de fondos ofrecidos en conjunto con sus Cuentas con el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">A. rdenes de Pago. Sujeto a los trminos y condiciones establecidos en este Contrato, el Banco est autorizado para aceptar y debitar a alguna de las Cuentas del Depositante en el Banco, sin limitacin alguna de la cantidad, cada orden de pagar (cada una la Orden de Pago), o hacer que otro banco pague, una suma cierta de dinero (que puede ser en dlares de los Estados Unidos de Amrica o en cualquier otra moneda extranjera) a un beneficiario designado siempre y cuando que la Orden de Pago sea: (i) enviada por una Persona Autorizada, como se define ms adelante, o (ii) autorizada por el Depositante segn la ley aplicable. El Banco puede de tiempo en tiempo por notificacin escrita al Depositante establecer o enmendar reglas administrativas en relacin con las rdenes de Pago y el servicio de transferencia de fondos a ser provistos bajo este Contrato. Nada de lo establecido aqu obligar al Banco a aceptar y ejecutar una Orden de Pago, o la cancelacin o enmienda de sta; y solamente se entender que el Banco ha aceptado una Orden de Pago, su cancelacin o enmienda, al momento de su ejecucin. Usted deber indemnizar y mantener a el Banco libre de toda responsabilidad, reclamos, prdidas, costos y gastos (incluyendo gastos de abogado) que resulten de la ejecucin por parte de el Banco de cualquier cancelacin o enmienda de una Orden de Pago.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">B. Personas Autorizadas. Cualquier persona que tenga firma autorizada en alguna Cuenta ser considerada como una Persona Autorizada para efectos de esta Seccin. El Depositante ser responsable por mantener actualizadas las Personas Autorizadas designadas en su Cuenta. Cualquier cambio en relacin con las Personas Autorizadas, y cualesquiera otras rdenes dadas al Banco, puede ser realizada por el Depositante solamente por medio de una notificacin escrita a el Banco y dichos cambios sern efectivos no antes de diez (10) das calendarios desde la fecha de la notificacin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">C. Insuficiencia de Fondos. Si el Banco recibe una Orden de Pago y la Cuenta no tiene fondos suficientes para cubrir la Orden de Pago, el Banco puede, en su absoluta discrecin, pero no est obligado a aceptar la Orden de Pago: (i) creando un sobregiro en la Cuenta, o (ii) transfiriendo fondos de alguna otra Cuenta del Depositante a la Cuenta sobre la que se emiti la Orden de Pago, en cualquier caso slo en la medida de los fondos que faltan. El Banco puede debitar la Cuenta por la cantidad de la Orden de Pago (aunque la Orden de Pago puede ser en beneficio de uno de los oficiales del Depositante, agentes, o empleados), ms la respectiva comisin. Si la cuenta no tiene fondos suficientes para debitar la comisin establecida por el Banco, ste podr abstenerse de procesar la Orden de Pago. Si la Orden de Pago genera un sobregiro, el Depositante debe prontamente pagar al Banco la cantidad del sobregiro, junto con la comisin por el sobregiro y el inters sobre el mismo a la tasa de inters anual que cobra el Banco por los sobregiros. Usted acuerda que el Banco puede compensar la cantidad del sobregiro y el inters contra los fondos de alguna otra Cuenta que usted tiene en el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">D. Enmiendas o Cancelacin. El Banco no est obligado a aceptar o efectuar cualquier enmienda o cancelacin de cualquier Orden de Pago enviada a el Banco, y en cualquier caso podr condicionar su accin al: (i) recibo de informacin razonable identificando la Orden de Pago original, (ii) cumplimiento con los procedimientos de seguridad establecidos en la Solicitud de Producto, (iii) recibo de un acuerdo de indemnizacin o caucin u otra forma de seguridad aceptable por el Banco, segn la cual el Banco ser resarcida por todas las prdidas, gastos (incluyendo gastos de abogado) y otras obligaciones que puedan resultar de la ejecucin de la enmienda o cancelacin de la Orden de Pago, y (iv) recibo de la peticin de la enmienda o cancelacin no mas tarde del tiempo de cierre (tal como lo establece el Banco de tiempo en tiempo) del da laboral anterior al da en que se va a ejecutar o pagar la Orden de Pago original. El Depositante estar obligado por la enmienda o cancelacin de la Orden de Pago en la misma medida que hubiera estado obligado por el envo de la Orden de Pago bajo esta misma Seccin.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">E. Tiempo de Cierre. rdenes de Pago, enmiendas o cancelaciones debern ser comunicadas al Banco durante las horas de operacin en que el Banco est abierto para el recibo, procesamiento y transmisin de rdenes de Pago, enmiendas y cancelaciones de acuerdo con el horario de cierre establecido por el Banco de tiempo en tiempo. Ordenes de Pago, enmiendas o cancelaciones recibidas despus de dicho horario de cierre sern consideradas como recibidas el da hbil siguiente para transferencia de fondos.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">F. Banco Beneficiario; Banco Intermediario.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(1) Falta de Identificacin. Si una Orden de Pago no designa el banco del beneficiario, el Banco en su discrecin puede realizar el pago a cualquier agencia en la cual tenga razn para creer que el beneficiario tiene una cuenta o tratar de buscar instrucciones adicionales del Depositante, y en cualquier caso el Banco no ser responsable por prdidas que resulten de la falla del Depositante de identificar apropiadamente el banco donde el beneficiario mantiene una cuenta.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(2) Intermediarios. El Depositante puede dar instrucciones al Banco a travs del formato Solicitud de Transferencia para el envo de rdenes de Pago a travs de corresponsales que considere apropiados despus de consultar el manual de referencia del Banco de las relaciones con corresponsales. Al momento de ejecutar una Orden de Pago, el Banco puede utilizar cualquier sistema de transferencia de fondos, sistemas de comunicaciones, y agencias intermediarias designadas por el Depositante, excepto donde el Banco de buena fe concluye que el uso de tal sistema de transferencia de fondos, sistema de comunicaciones, o intermediario no es posible o se demorara mucho, en tal caso el Banco debera usar el sistema de transferencia de fondos en los cuales el Banco participa (por ejemplo SWIFT), y tales intermediarios, agentes o subagentes que el Banco considere pertinentes para ejecutar la Orden de Pago. En la medida que sea permitido por la ley, (i) cualquier transferencia de fondos o sistema de comunicaciones, intermediarios, agente o subagente sern considerados como agentes del Depositante y el Banco no estar bajo ninguna responsabilidad por cualquier error, negligencia, o falla de alguno de ellos o por alguna falla de identificar el beneficiario o cualquier mal pago por alguno de ellos, y (ii) el Banco no ser responsable por ningn error, mutilacin, demora, mal entrega o falla en la entrega de la transferencia de alguna Orden de Pago en conexin con dicha transaccin o por cualquiera interrupcin de cualquier medio de transmisin o por alguna imposicin de alguna censura, control de cambios u otra restriccin, todos estos riesgos perteneciendo al Depositante.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">G. Nmeros de Identificacin. Al ejecutar la Orden de Pago, el Banco podr confiar exclusivamente en el nmero de identificacin de cuenta de un beneficiario, banco del beneficiario o banco intermediario en vez de nombres an si ambos son identificados. El Banco no tendr la obligacin de detectar alguna inconsistencia entre el nombre y cualquier dicho nmero incluido en una Orden de Pago. El Depositante ser responsable por tales inconsistencias e indemnizar y mantendr libre al Banco de toda prdida, obligacin, gasto o dao que pueda ocurrir como resultado de tal inconsistencia, incluyendo sin limitacin, gastos de abogado y gastos de litigio.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">H. Solicitud de Informacin. Una vez solicitada, el Depositante proveer al Banco con toda informacin de transacciones que sea necesaria para que el Banco pueda manejar las preguntas y rastreos, incluyendo pero sin limitacin, cantidades en dlares, cuentas afectadas, fechas, y beneficiarios.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">I. Rechazos. Si el Banco determina no ejecutar una Orden de Pago recibida del Depositante, el Banco deber notificar al Depositante de tal decisin utilizando la misma forma de comunicacin utilizada por el Depositante para transmitir la Orden de Pago a el Banco o por comunicacin con el Depositante de acuerdo con los procedimientos para notificaciones contenidas aqu o definidas por el Banco de tiempo en tiempo. El Depositante acuerda que lo anterior constituye una manera comercialmente razonable de dar notificacin y acepta que Ordenes de Pago comunicadas a el Banco por una forma que no cumple con esta Seccin no puede ser ejecutada por el Banco y el Banco no est obligado de dar la notificacin de rechazo al Depositante.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">J. Registros. El Banco est autorizado (pero no est obligado) a registrar electrnicamente y a grabar conversaciones telefnicas entre el Depositante y/o Personas Autorizadas y el Banco. La forma como el Banco entienda rdenes verbales ser determinante en el evento de una discrepancia, con alguna confirmacin por escrito de dicha orden, sin importar si el Banco grab la conversacin o no, o si alguna grabacin que est disponible no se entiende.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">K. Depositantes del Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(1) Responsabilidad por Prdidas Sufridas por el Originador. Si bajo la ley aplicable el Depositante no es considerado como el originador de la transferencia de fondos a la cual la Orden de Pago se refiere, el Depositante acuerda indemnizar y mantener a el Banco libre de cualquier prdida o responsabilidad para con dicho originador siempre y cuando tal prdida o responsabilidad no hubiera ocurrido si el Depositante hubiera sido el originador.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(2) Bancos Fuera de Lnea. Si el Depositante es un banco fuera de lnea, y el Depositante no notifica expresamente al Banco por escrito que mantiene una cuenta para otro banco, el Depositante garantiza al Banco que el Depositante no acta como un banco intermediario o como banco del beneficiario con respecto a rdenes de Pago recibidas a travs de los sistemas de transferencias de pago por el beneficiario que es una agencia.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">L. Estados de Cuenta y Notificacin de Errores. Si el Depositante lo solicita, el Banco deber proveerle estados de cuenta peridicos o avisos describiendo cada Orden de Pago realizada a nombre del Depositante. Dentro de un trmino razonable de tiempo que no exceda cinco (5) das laborales despus de haber recibido tal informacin o el da laboral prximo despus del recibo de un aviso, el que ocurra primero, el Depositante debe notificar a el Banco de cualquier discrepancia, transacciones no autorizadas u otros errores. Si tal comunicacin es notificada verbalmente, deber ser confirmada por escrito prontamente por el Banco. El Depositante ser considerado como si hubiese recibido cualquier informacin enviada por correo por el Banco cinco (5) das laborales despus que dicha informacin es enviada.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">M. Tarifas. El Banco puede cobrar, y el Depositante debe de pagar prontamente, las comisiones y cargos aplicables por los servicios prestados bajo esta Seccin. A menos que se haya estipulado por escrito, el Banco est autorizado para cobrar tales tarifas por medio de dbitos a la Cuenta.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">N. rdenes de Pago que Llegan. rdenes de Pago aceptadas por el Banco y recibidas como crdito para ser depositadas en las Cuentas del Depositante, a opcin de el Banco, sern aceptadas electrnicamente, por correo de primera clase o segn se acuerde de otra forma.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">O. Limitacin de Responsabilidad - Deber de Cooperar.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(1) El Banco no estar obligado a aceptar, y no ser responsable por no aceptar, cualquier Orden de Pago. El Banco no ser responsable por fallas, tardanzas, errores, reclamos o daos en la ejecucin o cumplimiento de cualquier transferencia ocasionada por falla o negligencia de cualquier otro banco o parte, como tampoco ser responsable el Banco por alguna otra causa ms all del control del Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(2) El Banco no ser responsable por ningn pago de daos consecuenciales, especiales, indirectos, punitivos o ejemplares, o prdidas que el depositante pueda incurrir o sufrir por razn de las acciones del Banco u omisin en relacin con una transferencia de fondos.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(3) El Depositante reconoce que el Banco est sujeto a leyes y regulaciones y estndares internacionales y acuerda que el Banco puede negarse a cumplir cualquier actividad que est en conflicto o sea inconsistente con tales leyes o regulaciones o estndares internacionales.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(4) El Banco no ser responsable por prdidas o daos que resultan de su inhabilidad para completar una transferencia u Orden de Pago solicitada por el Depositante debido a actos de fuerza mayor, incendios, inundaciones, huracanes, accin de alguna autoridad gubernamental, mecnico, computadores, telecomunicaciones o fallas elctricas, mal funcionamiento de equipos, guerras, insurrecciones civiles, actividades terroristas de la guerrilla, huelgas, paros, bloques, o cualquier otra circunstancia similar.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(5) El Depositante confirma a el Banco que ninguna de las provisiones de esta Seccin, como tampoco ninguna transaccin contemplada bajo esta Seccin violar ninguna ley de control de cambios o ninguna otra restriccin legal aplicable al Depositante.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(6) El Depositante tendr que firmar cualquier documento y realizar cualquier acto requerido por el Banco para poder asistirlo en cobrar fondos de o en relacin con cualquier otra transaccin con cualquier tercera persona o personas.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">P. Indemnizacin. Excepto como est limitado por la ley, usted acuerda indemnizar a el Banco y mantener a el Banco libre de todo dao en relacin con cada uno y todos de los siguientes (las Obligaciones):</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(i) cualquier costo o gasto incurrido por el Banco en la ejecucin de una Orden de Pago o en cumplimiento con los trminos y condiciones de este Contrato;</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(ii) todas obligaciones con terceras personas que surgen de, o en relacin con, los trminos y condiciones de este Contrato y/o la ejecucin de una Orden de Pago por parte del Banco;</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">(iii) cualquier y todos los reclamos, demandas, procesos, multas y penalidad que resulten de la ejecucin de una Orden de Pago por parte del Banco o de otra manera en cumplimiento de cualquier deber u obligacin que resulte de los trminos y condiciones de este Contrato; y</span></font></p><p style="margin-bottom: 0.14in"><span lang="es-AR">(iv) cualquier dao, prdida, costos y gastos (incluyendo gastos de abogado razonables) sufridos o incurridos por</span> <font size="3"><span lang="es-AR">el Banco como resultado de cualquiera de lo anterior o por el incumplimiento de alguna ley o condicin por parte de usted. El Banco est aqu autorizado a</span></font> <font size="3"><span lang="es-AR">compensar la cantidad de alguna obligacin contra cualquiera de sus Cuentas en el Banco.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Q. Moneda Extranjera. Si el Banco recibe una Orden de Pago de usted en la cual se ordena el pago en una moneda distinta de dlares de los Estados Unidos, el Banco puede proceder a debitar la Cuenta antes de ejecutar la Orden de Pago por el equivalente en dlares de los Estados Unidos de la moneda extranjera a ser pagada, a la tasa de cambio que tenga el Banco. Usted adems acuerda que la ejecucin de una Orden de Pago la cual requiere pago en una moneda diferente de dlares de los Estados Unidos puede demorarse un tiempo prudencial para permitirle al Banco realizar el cambio de moneda.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">17. ORIGEN DE FONDOS; CUMPLIMIENTO CON LALEY</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Depositante acepta y reconoce que el Banco est obligado bajo la ley aplicable y sus reglamentos y procedimientos internos a tomar medidas para combatir el uso de los productos del Banco, servicios y oficinas para llevar a cabo transacciones de lavado de dinero y otras actividades ilcitas. El Depositante se compromete a entregar al Banco cualquier informacin, y cumplir con cualquier procedimiento que el Banco razonablemente le solicite, con la finalidad de cumplir con las obligaciones que le sean exigible de conformidad con la legislacin aplicable y los estndares internacionales vigentes para combatir el blanqueo de capitales y financiamiento del terrorismo. El Depositante acepta que el incumplimiento de este compromiso, podra resultar en la suspensin de los procesos de vinculacin y apertura de Cuenta, la suspensin de la transaccin, la devolucin de recursos o el cierre de la Cuenta. El Depositante reconoce y acepta que en cumplimiento de dichas leyes y estndares internacionales, el Banco tendr que divulgar informacin sobre el Depositante y sus Cuentas.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Adicionalmente, el Depositante representa, garantiza y acuerda que todos los fondos existentes y los que sern depositados en la Cuenta tendrn un origen legal, y que el Depositante no efectuar ni iniciar ninguna transaccin en o a travs de la Cuenta que sea ilegal bajo las leyes de la Repblica de Panam, o cualquier otra jurisdiccin cuyas leyes le sean aplicables a dicha transaccin.</span></font></p><p style="margin-bottom: 0.14in" lang="es-AR"><br/> </p><p style="margin-bottom: 0.14in" lang="es-AR"><br/> </p><p style="margin-bottom: 0.14in" lang="es-AR"><br/> </p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">18. CONTRATO COMPLETO; INTERPRETACIN DELCONTRATO</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Este Contrato y todos los documentos que gobiernan la relacin del Cliente con el Banco, incluyendo la Solicitud de Producto para el producto o servicio particular, constituyen acuerdo entre las partes en relacin con los trminos y condiciones contenidos en este Contrato. De existir una discrepancia entre los trminos de la Solicitud de Producto y este Contrato, prevalecer lo dispuesto en la Solicitud de Producto. Si alguno de los trminos o secciones de este Contrato es declarado invlido, ilegal, o sin validez legal alguna por un tribunal con jurisdiccin competente, la validez, legalidad, u obligatoriedad de los trminos y Secciones restantes de este Contrato no se ver afectado ni impedido por dicha declaracin de ilegalidad. La ambigedad de algunas de las Secciones de este Contrato no ser interpretada en contra del Banco por el hecho que el Banco o su asesor legal fueron los que redactaron dicha Seccin. La utilizacin de subttulos en este Contrato es solamente por conveniencia; ningn subtitulo es parte de este Contrato o deber afectar el significado o interpretacin de este Contrato.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">19. RENUNCIA A LA INMUNIDAD SOBERANA</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">En la medida que alguno de ustedes tenga o ms tarde adquiera inmunidad de la jurisdiccin que pueda tener cualquier tribunal o de cualquier proceso legal (sin importar si es por notificacin de demanda, vinculacin antes de la sentencia, vinculacin para facilitar la ejecucin de la sentencia, ejecucin o de otra forma) con respecto a usted o a sus activos, usted por este Contrato renuncia irrevocablemente a tal inmunidad en relacin con sus obligaciones bajo este Contrato y, sin limitar la generalidad de lo anterior, acuerda que usted renuncia a tal inmunidad por este Contrato en la medida que tal renuncia sea permitida por la legislacin aplicable.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">20. OBLIGATORIEDAD DEL CONTRATO; RESTRICCIN EN LA CESIN</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">Este Contrato ser obligatorio para los herederos, representantes legales, sucesores y asignatarios. No obstante lo anterior, sus derechos y obligaciones bajo este Contrato no podr ser cedido por usted sin el consentimiento previo por escrito de el Banco, y cualquier cesin de este sin dicho consentimiento previo por escrito lo har nulo y sin efecto legal alguno.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">21. SERVICIO DE VALIJA</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">ELBANCO podr ofrecer eventualmente al cliente, directamente o por medio de sus representantes autorizados en el extranjero, el servicio de correo o de valija para el envo de sus consignaciones con destino a su cuenta. En tal caso, el Depositante acepta que la prestacin de este servicio se dar exclusivamente por su cuenta y riesgo, y por lo tanto exonera al BANCO de cualquier responsabilidad por la prdida o extravo de los cheques o documentos remitidos por consignacin; y estar sujeto a las comisiones y cargos por cuenta de terceros aplicables segn la Tabla de Productos y Tarifas.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">22. DERECHO A RENUNCIAR DEL BANCO.</span></font></p><p style="margin-bottom: 0.14in"><font size="3"><span lang="es-AR">El Banco puede sin prejuicio a este Contrato en aspecto alguno, renunciar a cualquiera de los trminos y provisiones anteriores en un caso en particular, pero dicha renuncia aplica solamente a ese caso especfico.</span></font></p>');
